	<main>
		<p>B'kollox ippubblikajna kliem: 327257, xogħlijiet: 148, vokabularju: 37949.

		<form>
			<textarea type="text" id="myInput" autocomplete="off"></textarea>
			<input type="button" onclick="myFunction()" value="Iċċekkja" />

		<ul id="output"><!-- --></ul>

	<script>
	function myFunction() {
		var input, ul, li, a, i, txtValue;
		input = document.getElementById("myInput");
		const textVocab = findUniqueWords(input.value);
		const output = document.getElementById("output");
		const words = textVocab.filter((word) => !vocabulary.includes(word));
		const uniqueWords = [...new Set(words)];
		output.innerHTML = uniqueWords.map((word) => `<li>${word} ${vocabulary.includes(word)}</li>`).join("");
	}

	const stripTags = (html) => {
		const doc = new DOMParser().parseFromString(html, "text/html");
		return doc.body.textContent || "";
	}

	const findUniqueWords = (text) => {
    // Normalize to lowercase for case-insensitive comparison
    text = text.normalize('NFC').toLowerCase();

    // Use regex to match words, including Unicode characters
    const words = text.match(/\p{L}+/gu) || []; // \p{L}+ matches any letter character in any language

    // Store unique words in a Set
    const uniqueWords = new Set(words);

    return Array.from(uniqueWords);
}

</script>
